g_f_dict_config.f_dict_area[1] = {1,110000,"臣纳兰明珠今有一本请奏：\
蒙古准噶尔部葛尔丹，多年以来，图谋不轨，屡次侵扰蒙古各部，今日他变本加厉，竟然大举吞并了漠西漠北多个部落，已然逼近北京。臣恳请皇上，御驾亲征，必可一战而生，收复失地，威震大漠。臣复乞陛下，臣愿为先锋，为陛下上阵杀敌！\
兵部尚书纳兰明珠",1,5 }
g_f_dict_config.f_dict_area[2] = {2,110001,"臣张廷玉今有一本请奏：\
自葛尔丹伏诛以来，蒙古并未风平浪静，准噶尔部策妄阿拉布坦已然不服朝廷调遣，多次侵扰临疆。又有其子噶尔丹策零，竟入侵西藏，实在是忍无可忍。臣恳请皇上，派遣精兵良将，出征西域，彻底平定西北，以绝后患。臣复乞陛下，即刻出征，军情紧急，刻不容缓。\
吏部尚书、军机大臣张廷玉",6,10 }
g_f_dict_config.f_dict_area[3] = {3,110002,"臣图海今有一本请奏：\
三藩之乱已起，如今陕西王辅臣亦投靠吴贼，我大清形势岌岌可危。臣恳请皇上，派兵前往征讨，臣愿为先锋，先斩王辅臣，随机便可南下擒拿吴三桂，定可一战功成。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
抚远大将军图海",11,15 }
g_f_dict_config.f_dict_area[4] = {4,110003,"臣阿桂今有一本请奏：\
三藩之乱虽平，然西南并未安宁。先有西藏廓尔喀反叛，后有川南大小金川联合土司作乱，百姓死伤无数。今日又闻缅甸安南祸起，战火已燃到我朝边境。臣恳请皇上，派兵前往征讨，臣愿为先锋，荡平西南诸乱，为皇上分忧。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
一等英勇公、军机大臣章佳·阿桂",16,20 }
g_f_dict_config.f_dict_area[5] = {5,110004,"臣姚启圣、施琅今有一本请奏：\
如今我朝疆域，西北、西南皆平，唯独东南台湾，郑氏反贼，拒不归降，负隅顽抗。我朝实施海禁以来，台湾虚弱不堪，如今正是收复良机。臣恳请皇上，速速派遣精兵良将，前往征讨，臣等愿为先锋，率领水师，征讨澎湖、台湾，为皇上分忧。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
福建总督姚启圣、福建水师提督施琅",21,25 }
g_f_dict_config.f_dict_area[6] = {6,110005,"臣曾国藩今有一本请奏：\
大清危矣，南方长毛作乱，已攻破南京！若不速速出兵镇压，待其养精蓄锐，一旦北上，我朝将危在旦夕。臣恳请皇上，速速派遣精兵良将，前往征讨，臣愿为先锋，率领湘军、淮军，配合八旗官兵，一同剿灭太平乱贼，为皇上分忧。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
两江总督曾国藩",26,30 }
g_f_dict_config.f_dict_area[7] = {7,110006,"臣僧格林沁今有一本请奏：\
自扫平长毛以来，东南匪患未绝，后竟如雨后春笋，层出不穷，天地会、红花会、天理教等邪派匪帮，群起作乱。捻军余孽，亦流窜于东南、中原。臣恳请前往剿匪，率领满蒙八旗，荡平匪患，为皇上分忧。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
御前大臣僧格林沁",31,35 }
g_f_dict_config.f_dict_area[8] = {8,110007,"臣袁世凯今有一本请奏：\
近日直隶山东一带，兴起义和团运动，百姓纷纷参与，其势建大，今尽然公然作乱反叛，不服朝廷安抚，其乱已入北京。臣恳请前往率兵镇压，守卫京师。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
山东巡抚袁世凯",36,40 }
g_f_dict_config.f_dict_area[9] = {9,110008,"臣林则徐今有一本请奏：\
臣查鸦片之害，祸国祸民，白银外流，民体不康，长此以往，国将不国矣。臣恳请前往广东，严禁鸦片，驱除洋人。若其反抗，臣愿守卫疆土，以身殉国。臣复乞陛下，准许前往，臣定当不负皇恩，诚惶诚恐，微臣草上。\
两江总督林则徐",41,45 }
g_f_dict_config.f_dict_area[10] = {10,110009,"臣李鸿章今有一本请奏：\
我朝自古与朝鲜唇齿相依，今东瀛竟渡海进攻，朝鲜危在旦夕，已向我朝求援。所谓唇亡齿寒，东瀛野心勃勃，若朝鲜落入其手，我辽东亦不可保矣。臣跪乞陛下，派遣精兵入朝增援，我北洋水师亦可从水路前往策应，水陆并进，必可讲东瀛之贼赶出朝鲜，诚惶诚恐，微臣草上。\
直隶总督，北洋通商大臣李鸿章",46,50 }
g_f_dict_config.f_dict_area[11] = {11,110010,"臣李鸿章今有一本请奏：\
自道光年间鸦片祸起，西方夷狄屡次入侵我朝疆土，然我军将士奋勇杀敌，三军用命，无论是英法俄，还是东瀛日本，都无法如愿。今日，以上诸国竟联手前来，结成八国联盟，欲直取京师。臣跪乞陛下，征调各地勤王部队，守卫京师，此事关重大，望陛下速速决断，诚惶诚恐，微臣草上。\
直隶总督，北洋通商大臣李鸿章",51,55 }
g_f_dict_config.f_dict_area[12] = {12,110011,"臣今有一本请奏：\
据八国联军入侵我朝已多年，我朝国力繁荣，国威大盛，西方列国却元气大伤。朝鲜自甲午战争后便被东瀛日本所霸占，朝鲜百姓时时刻刻不想回归陛下庇护之下。臣跪乞陛下，派遣精兵良将，收复朝鲜，远征东瀛，以报他日被侵略之仇，诚惶诚恐，微臣草上。\
兵部尚书",56,60 }
g_f_dict_config.f_dict_area[13] = {13,110012,"臣今有一本请奏：\
西方列强多次侵犯我朝，臣至今难忘，虽然我朝将士奋勇杀敌，将其一一击退，然我朝百姓却屡遭其祸。如今，沙俄已经臣服，我朝疆土与欧罗巴诸国相接，若不再接再厉，将其一一击败，岂不有愧与我朝百姓。臣跪乞陛下，派遣精兵良将，远征欧罗巴，报仇雪恨，一雪前耻，诚惶诚恐，微臣草上。\
兵部尚书",61,65 }
g_f_dict_config.f_dict_area[14] = {14,110013,"臣今有一本请奏：\
如今天下大势，一分为二，我朝雄踞东方，万国臣服，唯有大洋彼岸的美利坚，自恃国强兵盛，远居海外，对我朝甚是不敬。如今我朝水师日日加紧训练，广造船舰，已准备妥当。臣跪乞陛下，派遣精兵良将，跨洋远征美利坚，若能成功，则我朝将一统寰宇，皇上将成为千古一帝，诚惶诚恐，微臣草上。\
兵部尚书",66,70 }



